tables.table_schema:
CREATE TABLE patient_health_data (
    patient_id INT PRIMARY KEY,
    timestamp TIMESTAMP,
    heart_rate INT,
    steps_count INT
);

CREATE TABLE Patients (
    patient_id UUID PRIMARY KEY,
    name STRING,
    age INT,
    gender STRING
);

CREATE TABLE HeartRate (
    heart_rate_id UUID PRIMARY KEY,
    patient_id UUID,
    heart_rate_value INT,
    recorded_at TIMESTAMP
);

CREATE TABLE StepCount (
    step_count_id UUID PRIMARY KEY,
    patient_id UUID,
    steps INT,
    recorded_at TIMESTAMP
);

CREATE TABLE SleepData (
    sleep_data_id UUID PRIMARY KEY,
    patient_id UUID,
    duration_in_minutes INT,
    recorded_at TIMESTAMP
);

CREATE TABLE Temperature (
    temperature_id UUID PRIMARY KEY,
    patient_id UUID,
    temperature_value FLOAT,
    recorded_at TIMESTAMP
);
